const block1 = (context) => { return html`<header class="ui5-popup-header-root" id="ui5-popup-header" tabindex="${ifDefined(context._headerTabIndex)}" @keydown="${context._onDragOrResizeKeyDown}" @mousedown="${context._onDragMouseDown}">${ context.header.length ? block2(context) : block3(context) }</header>`; };
