const block3 = (context) => { return html`<h2 id="ui5-popup-header-text" class="ui5-popup-header-text">${ifDefined(context.headerText)}</h2>`; };
const block4 = (context) => { return html`<footer class="ui5-popup-footer-root"><slot name="footer"></slot></footer>`; };
const block5 = (context) => { return html`<${scopeTag("ui5-icon", tags, suffix)} name="resize-corner" dir="${ifDefined(context.effectiveDir)}" class="ui5-popup-resize-handle" @mousedown="${context._onResizeMouseDown}"></${scopeTag("ui5-icon", tags, suffix)}>`; };


	return block0(context);
};

export default main;
